import React from "react";
import { StatusBar } from "expo-status-bar";
import {
	StyleSheet,
	Text,
	View,
	Image,
	SafeAreaView,
	Button,
} from "react-native";

export default function MySquad() {
	return (
		<SafeAreaView style={styles.container}>
			<View style={styles.marginContainer}>
				<Button title="Add new squad" onPress={handleNewSquad} />
			</View>
		</SafeAreaView>
	);
}

const styles = StyleSheet.create({
	container: {
		flex: 1,
		backgroundColor: "#fff",
	},
	genreMenuImg: {
		width: 70,
		height: 70,
	},
	marginContainer: {
		marginHorizontal: "3%",
		marginTop: "1%",
		height: "100%",
		alignItems: "center",
		justifyContent: "center",
	},
});

